import React, { useState, useEffect } from 'react'
import data from './../../data/data'
import './dashboard.css'

export default function Dashboard() {
    return (
        <div>
            <h3> Hello it is data</h3>
            <table>
                <th>
                    <td>Invoice Number</td>
                    <td>Customer Name</td>
                    <td>Email</td>
                    <td>Purchase Date</td>
                    <td>Amount</td>
                    <td>Status</td>
                    <td>Tracking</td>
                </th>
            </table>
            {data.dashBoardData.map((el,ind) => {
                return (
                    <li>{ind + 1} : {el.first_name} - {el.last_name}</li>                    
              )
          })}
        </div>
    )
}
